prompt Creating PERSON...
create table PERSON
(
  address   VARCHAR2(40),
  mail      VARCHAR2(30),
  mainphone VARCHAR2(11),
  age       INTEGER,
  pname     VARCHAR2(30) not null,
  personid  NUMBER not null
)
;
alter table PERSON
  add constraint PERSON_KEY primary key (PERSONID);

prompt Creating ACTIVITYOPERATOR...
create table ACTIVITYOPERATOR
(
