  expertise VARCHAR2(40) not null,
  gender    VARCHAR2(15) not null,
  personid  NUMBER not null
)
;
alter table ACTIVITYOPERATOR
  add constraint AO_KEY primary key (PERSONID);
alter table ACTIVITYOPERATOR
  add constraint FK_ACTIVITYOPERATOR_PERSONID foreign key (PERSONID)
  references PERSON (PERSONID);

prompt Creating BOOKCLASS...
create table BOOKCLASS
